  true,\n\t\"url\": null,\n\t\"notes\": \"The Chemical and Product Categories database
  (CPCat) catalogs the use of over 40,000 chemicals and their presence in different
  consumer products. The chemical use information is compiled from multiple sources
  while product information is gathered from publicly available Material Safety Data
  Sheets (MSDS). EPA researchers are evaluating the possibility of expanding the database
  with additional product and use information.\",\n\t\"license_title\": \"Other License
